import React from 'react'
import Typist from "react-typist";

const Intro = () => {
  return (
    <div className='introduction'>
        <Typist>
            <span className="intro-title">
                {"hello, this is "}
                <span className="intro-name">{"Larbi"}</span>
            </span>
        </Typist>
    </div>
  )
}

export default Intro
